import React from 'react';
import Timer from './Timer';
import YouTubeEmbed from './YouTubeEmbed.js';
import TotalTimer from './TotalTimer';

function App() {
  return (
    <div>
      <Timer/>
      <YouTubeEmbed />
      <TotalTimer />
    </div>
  )
}

export default App;
